import React from 'react';
import s from './User.module.css'

const User = ({avatar, name, onLogout}) => {
    return (
        <div className={s.container}>
            <h2>Welcome, {name}!</h2>
            <img src={avatar} alt={name}/>
            <button type={button} onClick={ () => {} }>Logout</button>
        </div>
    );
};

export default User;
